  false,\n\t\"url\": null,\n\t\"notes\": \"A preliminary summary of a study of contaminants
  in waterbirds and in the western grasslands of Merced County. The purpose of this
  study was two-fold: 1) to determine the geographical extent of contaminants deposited
  in the West Grasslands as a result of previous use of subsurface drainwater, and
  2) to determine the levels of contaminants in aquatic birds and their food chain
  after the application of fresh irrigation water on private and public wetlands of
  the West Grasslands. A complete biological and statistical interpretation of the
  information contained within this report, as well as additional trace element data,
  will be provided in the final report.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
